function EventEmitter(){var t=[];this.addEventListener=function(n,e){t.push({type:n,fn:e})},this.removeEventListener=function(n,e){for(var i=0,r=t.length;r>i;i++)if(t[i].type==n&&t[i].fn==e)return t.splice(i,1)},this.dispatchEvent=function(n){for(var e=0,i=t.length;i>e;e++)t[e].type==n.type&&t[e].fn(n)}}